import React from "react";
import { Row } from "antd";
import UserLayout from "./userlayout";

export default function Overview() {
  return (
    <div>
        <UserLayout>
      <Row>
        <h2>Overview</h2>
      </Row>
      </UserLayout>
    </div>
  );
}
